type WalletServiceTestSuite struct {
	suite.Suite
	ctx        *core.ContextMock
	s          IWalletService
	rsaService IRSAService
	ms         *MockWalletService
	env        core.IENV
}

func TestWalletServiceTestSuite(t *testing.T) {
	suite.Run(t, new(WalletServiceTestSuite))
}

func (ts *WalletServiceTestSuite) SetupTest() {
	ts.ctx = core.NewMockContext()
	ts.env = core.NewENVPath("./../")
	ts.ctx.On("DB").Return(ts.ctx.MockDB.Gorm)
	ts.ctx.On("ENV").Return(ts.env)
	ts.s = NewWalletService(ts.ctx)
	ts.rsaService = NewRSAService(ts.ctx)
	ts.ms = NewMockWalletService()
}

func (ts *WalletServiceTestSuite) TestCreateWalletSuccess() {
	didAddress := utils.GenerateDID(utils.NewSha256(utils.GetCurrentDateTime().String()), "idin")

	ts.ctx.MockDB.Mock.
		ExpectQuery(regexp.QuoteMeta("SELECT * FROM `wallets` WHERE id = ? ORDER BY `wallets`.`id` LIMIT 1")).
		WithArgs(didAddress).
		WillReturnError(gorm.ErrRecordNotFound)
	ts.ctx.MockDB.Mock.
		ExpectExec(regexp.QuoteMeta("INSERT INTO `wallets` (`id`,`did_address`,`created_at`,`deleted_at`) VALUES (?,?,?,?)")).
		WithArgs(didAddress, didAddress, sqlmock.AnyArg(), nil).
		WillReturnResult(sqlmock.NewResult(1, 1))
	ts.ctx.MockDB.Mock.
		ExpectQuery(regexp.QuoteMeta("SELECT * FROM `wallets` WHERE id = ? ORDER BY `wallets`.`id` LIMIT 1")).
		WithArgs(didAddress).
		WillReturnRows(sqlmock.NewRows([]string{`id`, `did_address`, `created_at`, `deleted_at`}).
			AddRow(didAddress, didAddress, utils.GetCurrentDateTime(), nil))
	ts.ctx.On("NewError", mock.Anything, mock.Anything, mock.Anything).Return(nil)
	wallet, err := ts.s.CreateWallet(&WalletCreatePayload{
		DIDAddress: didAddress,
	})

	ts.NotEmpty(wallet)
	ts.NoError(err)
}

func (ts *WalletServiceTestSuite) TestCreateWalletDuplicatedDID() {
	didAddress := utils.GenerateDID(utils.NewSha256(utils.GetCurrentDateTime().String()), "idin")

	ts.ctx.MockDB.Mock.
		ExpectQuery(regexp.QuoteMeta("SELECT * FROM `wallets` WHERE id = ? ORDER BY `wallets`.`id` LIMIT 1")).
		WithArgs(didAddress).
		WillReturnRows(sqlmock.NewRows([]string{`id`, `did_address`, `created_at`, `deleted_at`}).
			AddRow(didAddress, didAddress, utils.GetCurrentDateTime(), nil))
	ts.ctx.On("NewError", mock.Anything, mock.Anything, mock.Anything).Return(emsgs.DuplicatedWallet)
	wallet, err := ts.s.CreateWallet(&WalletCreatePayload{
		DIDAddress: didAddress,
	})

	ts.Empty(wallet)
	ts.Error(err)
	ts.Equal(emsgs.DuplicatedWallet, err)
}

func (ts *WalletServiceTestSuite) TestAddVCSuccess() {
	didAddress := utils.GenerateDID(utils.NewSha256(utils.GetCurrentDateTime().String()), "idin")

	header := map[string]interface{}{
		"alg": "HS256",
		"typ": "JWT",
		"kid": "did:example:abfe13f712120431c276e12ecab#keys-1",
	}

	claims := helpers.JWTVCClaim{
		Subject:   didAddress,
		Id:        "http://example.edu/credentials/3732",
		Issuer:    didAddress,
		NotBefore: 1541493724,
		IssuedAt:  1541493724,
		ExpiresAt: 1573029723,
		Nonce:     "660!6345FSer",
		VC: helpers.JWTVC{
			Context: []string{
				"https://www.w3.org/2018/credentials/v1",
				"https://www.w3.org/2018/credentials/examples/v1",
			},
			Type: []string{"VerifiableCredential", "UniversityDegreeCredential"},
			CredentialSubject: map[string]interface{}{
				"degree": map[string]interface{}{
					"type": "BachelorDegree",
					"name": "Bachelor of Science and Arts",
				},
			},
			CredentialSchema: &helpers.JWTVCCredentialSchema{
				ID:   "foobar",
				Type: "UniversityDegreeCredential",
			},
		},
	}

	token, err := helpers.JWTVCEncoding(header, claims, []byte(utils.NewSha256(didAddress)))
	ts.NoError(err)
	ts.NotEmpty(token)

	ts.ctx.MockDB.Mock.
		ExpectQuery(regexp.QuoteMeta("SELECT * FROM `wallets` WHERE id = ? ORDER BY `wallets`.`id` LIMIT 1")).
		WithArgs(didAddress).
		WillReturnRows(sqlmock.NewRows([]string{`id`, `did_address`, `created_at`, `deleted_at`}).
			AddRow(didAddress, didAddress, utils.GetCurrentDateTime(), nil))
	ts.ctx.MockDB.Mock.
		ExpectExec(regexp.QuoteMeta("INSERT INTO `vcs` (`id`,`cid`,`schema_type`,`issuance_date`,`issuer`,`holder`,`jwt`) VALUES (?,?,?,?,?,?,?)")).
		WithArgs(sqlmock.AnyArg(),
			sqlmock.AnyArg(),
			sqlmock.AnyArg(),
			sqlmock.AnyArg(),
			sqlmock.AnyArg(),
			sqlmock.AnyArg(),
			sqlmock.AnyArg()).
		WillReturnResult(sqlmock.NewResult(1, 1))
	err = ts.s.AddVC(didAddress, &WalletAddVCPayload{JWT: token, Operator: didAddress})
	ts.NoError(err)
}

